    const checkoutHandler =(evt)=>{
        evt.preventDefault();
        alert('Test')
    }
    return (
        <form onSubmit={checkoutHandler}>
            <label>Name: </label>
            <input />
            <button onClick={props.onCancel}>Cancel</button>
            <button >Confirm</button>
        </form>
    )
}

export default Checkout;
